function getTodaysIndex(date)
{
	var d;
	if(date == undefined)
	{
		d = new Date();
		selectedPickerDate = d.toUTCString();
	}
	else
		d = date;
	
	var currMonth = d.getMonth() + 1; // since it is a 0 based index
	var currDate = d.getDate();
	var currYear = d.getFullYear();
	for(var i = 0; i < pDates.length; i++)
	{
		if( pDates[i].pDate == currDate 
			&&
			pDates[i].pMonth == currMonth
			&&
			pDates[i].pYear == currYear
			)
		{
			if(date == undefined)
				currentDateIndex = i;
			
			currentIndex = i;
			break;
		}	
	}
	if(date == undefined)
		fillTodaysValues();
	else
		fillSelectedDateValues();	
		
	getTodaysEvents();	
}

function fillTodaysValues()
{
	if(currentDateIndex != undefined)
	{
		fillValues(pDates[currentDateIndex]);
		currentIndex = currentDateIndex;
		$.datePicker.setValue(new Date());
		selectedPickerDate = new Date();
		getTodaysEvents();
	}
		
	else
		displayAlert();
}

function fillSelectedDateValues()
{
	if(currentIndex != undefined)
	{
		fillValues(pDates[currentIndex]);
	}
		
	else
		displayAlert();
}

function displayAlert()
{
	var dialog = Ti.UI.createAlertDialog({
		message : "Data not available",
		buttonNames : ['OK'],
		title: "UM Panchanga"
	});
	
	dialog.show();
}

function nextDate()
{
	if(currentIndex != undefined)
	{
		if(currentIndex < pDates.length-1)
		{
			var selectedObject = pDates[currentIndex + 1];
			currentDateSelected = new Date(selectedObject.pYear, selectedObject.pMonth-1, selectedObject.pDate);
			fillValues(pDates[currentIndex + 1]);
			currentIndex++;
			getTodaysEvents();
		}		
		else
			displayAlert();	
	}
	else
		displayAlert();
}

function onPreviousDateClick()
{
	if(currentIndex != undefined)
	{
		if(currentIndex >= 1)
		{
			var selectedObject = pDates[currentIndex - 1];
			currentDateSelected = new Date(selectedObject.pYear, selectedObject.pMonth-1, selectedObject.pDate);
			fillValues(pDates[currentIndex - 1]);
			currentIndex--;
			getTodaysEvents();
		}		
		else
			displayAlert();
	}
	else
		displayAlert();	
}

function fillValues(selectedDate)
{
	var sunRiseMinutes = selectedDate.sunRiseMinute;
	var sunSetMinutes = selectedDate.sunsetMinute;
	if(currentDateIndex != undefined)
	{
		var shrahdaTxt = selectedDate.shradhaTithi;
		var delim = "-";
		var regex = new RegExp(delim, "g");		
		shrahdaTxt = selectedDate.shradhaTithi.replace(regex, ",");
		shrahdaTxt = shrahdaTxt.substring(0,shrahdaTxt.length-1);
		
		if(parseInt(sunRiseMinutes) < 10)
			sunRiseMinutes = "0" + selectedDate.sunRiseMinute;
		if(parseInt(sunSetMinutes) < 10)		
			sunSetMinutes = "0" + selectedDate.sunsetMinute;
		$.lblSunriseTime.text = selectedDate.sunRiseHour + ":" + sunRiseMinutes + " AM";
		$.lblSunsetTime.text = selectedDate.sunSetHour + ":" + sunSetMinutes + " PM";
		$.lblMasa.text = selectedDate.masa;
		$.lblNakshatra.text = selectedDate.nakshtra;
		$.lblDate.text = selectedDate.pDate + " " + arrMonthNames[selectedDate.pMonth-1] + " " + selectedDate.pYear + ", " + selectedDate.pDay;
		$.lblKarana.text = selectedDate.karnan;
		$.lblTithi.text = selectedDate.tithi + "(" + shrahdaTxt + ")";
		$.lblYoga.text = selectedDate.yoga;
		//$.lblShrdha.text = shrahdaTxt;
		$.lblAyan.text = selectedDate.ayan;
		$.lblRitu.text = selectedDate.ritu;
		$.lblPaksha.text = selectedDate.paksha;
	}
}

