function getTodaysEvents()
{
	var d = currentDateSelected;
	$.btnEvents.text = "Events on " + d.getDate() + " " + arrMonthNames[d.getMonth()] + ", " + d.getFullYear();
	todayEvents = [];
	
	var currMonth = d.getMonth() + 1; // since it is a 0 based index
	var currDate = d.getDate();
	var currYear = d.getFullYear();
	
	
	// check for aradhane
	for(var i = 0; i < objAradhana.length; i++)
	{
		var event = {};
	
		if( objAradhana[i].aDate == currDate 
			&&
			objAradhana[i].aMonth == currMonth
			&&
			objAradhana[i].aYear == currYear
			)
		{
			event.name = objAradhana[i].name;
			
			var delim = ",";
			var regex = new RegExp(delim,"g");
			event.name =  "-- " + event.name.replace(regex,"\n-- ");
			event.eventDate = currDate;
			event.eventMonth = currMonth;
			event.eventYear = currYear;
			event.lat = objAradhana[i].lat;
			event.lng = objAradhana[i].lng;
			event.type = "Aradhane";
			todayEvents.push(event);
			break;
		}	
	}
	
	// check for ekadashi
	for(var j = 0; j < objEkadashi.length; j++)
	{
		var event = {};
		if( objEkadashi[j].eDate == currDate 
			&&
			objEkadashi[j].eMonth == currMonth
			&&
			objEkadashi[j].eYear == currYear
			)
		{
			event.name = objEkadashi[j].name;
			var delim = ",";
			var regex = new RegExp(delim,"g");
			event.name =  "-- " + event.name.replace(regex,"\n-- ");
			event.eventDate = currDate;
			event.eventMonth = currMonth;
			event.eventYear = currYear;
			event.lat = "";
			event.lng = "";
			event.type = "Ekadashi";
			
			todayEvents.push(event);
			break;
		}	
	}
	
	// check for festival
	for(var k = 0; k < objFestival.length; k++)
	{
		var event = {};
		if( objFestival[k].fDate == currDate 
			&&
			objFestival[k].fMonth == currMonth
			&&
			objFestival[k].fYear == currYear
			)
		{
			event.name = objFestival[k].name;
			
			var delim = ",";
			var regex = new RegExp(delim,"g");
			event.name =  "-- " + event.name.replace(regex,"\n-- ");
			event.eventDate = currDate;
			event.eventMonth = currMonth;
			event.eventYear = currYear;
			event.lat = "";
			event.lng = "";
			event.type = "Festival";
			
			todayEvents.push(event);
			break;
		}	
	}
	
	// check for tarpana
	for(var l = 0; l < objTarpana.length; l++)
	{
		var event = {};
		if( objTarpana[l].tDate == currDate 
			&&
			objTarpana[l].tMonth == currMonth
			&&
			objTarpana[l].tYear == currYear
			)
		{
			event.name = objTarpana[l].desc;
			
			var delim = ",";
			var regex = new RegExp(delim,"g");
			event.name =  "-- " + event.name.replace(regex,"\n-- ");
			event.eventDate = currDate;
			event.eventMonth = currMonth;
			event.eventYear = currYear;
			event.lat = "";
			event.lng = "";
			event.type = "Tarpana";
			
			todayEvents.push(event);
			break;			
		}	
	}
		
}

